import React from "react";

export const Tile = ({name, description}) => {
  return (
    <div className="tile-container">
      <p className="title-title">{name}</p>
       {Object.entries(description).map(([key, value], index) => (
        <p key={index} className="tile">
          {value}
        </p>
      ))}
    </div>
  );
};
